import React from 'react';
import './App.css';

const profiles = [
  { name: 'Paul Graham', image: '/images/paul_graham.jpg' },
  { name: 'Sam Altman', image: '/images/sam_altman.jpg' },
  { name: 'Bobak Tavangar', image: '/images/bobak_tavangar.jpg' },
  { name: 'Raj Nakarja', image: '/images/raj_nakarja.jpg' },
  { name: 'Ben Heald', image: '/images/ben_heald.jpg' },
];

function ProfileBox({ name, image, isPink }) {
  return (
    <div className={`profile-box ${isPink ? 'pink' : 'green'}`}>
      {image && <img src={image} alt={name} className="profile-image" />}
      <span>{name}</span>
    </div>
  );
}

function App() {
  return (
    <div className="container">
      <header>
        <h1>ROLODEX</h1>
        <div className="header-line"></div>
      </header>
      <h2>My Profiles</h2>
      <div className="profiles-grid">
        <div className="pink-boxes">
          <ProfileBox name="Add New Profile" isPink={true} />
          <ProfileBox name="Unnamed Profiles" isPink={true} />
        </div>
        {profiles.map((profile, index) => (
          <ProfileBox key={index} name={profile.name} image={profile.image} isPink={false} />
        ))}
      </div>
    </div>
  );
}

export default App;
